
AddScene = Scene
	PresetName = Vessel Titan
	Description = Good job, commander. After squeezing information out of our Ronin friend we found the location of a landing pad where our ship has been. Infiltrating the tower was easy. Unfortunately the records of the control tower teaches us that our bird has already flown and has taken Scarlett with it. But that's not the biggest problem we have right now. A gigantic coalition warship just landed and is keeping the Gryphon II from picking up our people. Scans indicate four generators inside the ship. Disabling these should render the ship inoperable for a few hours. Make it happen. The previous mission left us with a bit of gold which we can use to spend on a nearby space station. Spend it wisely.
